import { LOGIN, SIGNUP, CHECK } from '../actions/auth'
const initial = {
  token: localStorage.getItem('token'),
  isAuthenticated: null,
  isLoading: true,
  user: null,
  errors: {}
}

export default function (state = initial, action) {
  switch (action.type) {
  	case LOGIN:
  		return action.payload.data

    case CHECK:
    	console.log(action.payload.data)
      return action.payload.data

    default:
      return state
  }
}
